export const AppHeader = styled.div`
    display: flex;
`;

export const AppContainer = styled.div`
    display: flex;
`;

export const BooksContainer = styled.div`
    display: flex;
    flex-direction: column;
    gap: 10px;
    padding: 10px;
`;
